import React from 'react';
import BarcodeScannerComponent from 'react-qr-barcode-scanner';

export default function BarcodeScanner({ onDetected }) {
  return (
    <BarcodeScannerComponent
      onUpdate={(err, result) => {
        if (result) onDetected(result.text);
      }}
    />
  );
}
